// Make sure cookies banner exists in home page and works
cy.validateElement('#cookiebanner').validateElement('.c-button--personalize').validateElement('#popupFullConsent');
// Accept all cookies (first banner)
cy.get('#popupFullConsent').click().get('#popupFullConsent').should('not.be.visible');
// Cookies personalisation assertion testing
cy.get('.c-button--personalize').click({
  force: true
}).validateElement('body').validateElement(':nth-child(3) > :nth-child(1) > :nth-child(3) > .detail-btn').validateElement('.cookiebanner-personalize__accept-all').validateElement('.cookiebanner-personalize__close').get('#popupFullConsent').click({
  force: true
});
// Cookies banners should not be visible anymore ==> user accepted all cookies
cy.get('.cookiebanner-personalize__accept-all').get('[id^=bannerFullConsent]').should('not.be.visible');
// Cookies presonalization assertion testing (user action)
cy.get('.c-button--personalize').click({
  force: true
}).validateElement('.content > :nth-child(2)').validateElement(':nth-child(2) > :nth-child(2) > .c-checkbox > label');
// User personalize cookies
cy.validateElement('[id^=CybotCookiebotDialogBodyLevelButton]').get('[type="checkbox"]').first().uncheck({
  force: true
}).get('[type="checkbox"]').last().uncheck({
  force: true
}).get('[type="checkbox"]').first().check({
  force: true
}).get('[type="checkbox"]').last().check({
  force: true
});
// Submit the modifications (cookies banners should not be visible anymore ==> user accepted all cookies)
cy.get('[type="checkbox"]').last().uncheck({
  force: true
}).get('#CybotCookiebotDialogBodyLevelButtonLevelOptinAllowallSelection').click({
  force: true
}).get('.cookiebanner-personalize__accept-all').get('[id^=bannerFullConsent]').should('not.be.visible');
// User deny all cookies && submit the modifications
cy.get('.c-button--personalize').click({
  force: true
}).validateElement('[id^=CybotCookiebotDialogBodyLevelButton]').get('[type="checkbox"]').first().uncheck({
  force: true
}).get('[type="checkbox"]').eq(1).uncheck({
  force: true
}).get('[type="checkbox"]').last().uncheck({
  force: true
}).get('[type="checkbox"]').last().uncheck({
  force: true
}).get('#CybotCookiebotDialogBodyLevelButtonLevelOptinAllowallSelection').click({
  force: true
});
// Cookies banners and buttons should not be visible anymore (user refused all cookies)
cy.get('#CybotCookiebotDialogBodyLevelButtonLevelOptinAllowallSelection').should('not.be.visible').get('[id^=bannerFullConsent]').should('not.be.visible');
